          this.$axios({
            method: 'post',
            url: `/api/${this.txtSingular.toLowerCase()}`,
            data: {
              id: this.id,
              nombreCompleto: this.nombreCompleto,
              email: this.email,
              telefono1: this.telefono1,
              pais: this.pais,
              nuevoRegistro: this.nuevoRegistro
            }
          }).then(resp => {
            if (resp.data.result == 200) {
              this.$q.notify({
                color: "positive",
                message: "Registro guardado correctamente"
              });
            } else if (resp.data.result == 404) {
              this.$q.notify({
                color: "error",
                message: "Se detectó un inconveniente con la Base de Datos " + resp.data.msg
              });
            }
          }).catch(err => {
            console.log('Error al actualizar el registro', err);
          }).finally(() => {
            this.dlgEditar = false;
            this.loading = false;
            this.nuevoRegistro = false;
            this.loadingSave = false;
            this.getRecords();
          });
        } else {
          this.$q.notify({
            color: "error",
            message: "No se ha capturado correctamente la información"
          });
        }
      });
    },

    // onSubmit()
    onReset() {},

    agregaRegistro() {
      if (this.$refs.frmRegistro) {
        this.$refs.frmRegistro.resetValidation();
      }

      this.id = '';
      this.nombreCompleto = '';
      this.email = '';
      this.telefono1 = '';
      this.pais = 'us';
    },

    // agregaRegistro()
    borrarRegistro() {
      this.$q.dialog({
        title: this.nombreCompleto,
        message: 'El registro se eliminará definitivamente',
        cancel: true,
        persistent: true,
        cancel: {
          label: "Regresar",
          color: "white",
          textColor: "primary",
          flat: true
        }
      }).onOk(() => {
        this.loadingDelete = true;
        this.$axios({
          method: "delete",
          url: `/api/cliente/${this.id}`
        }).then(resp => {
          this.$q.notify({
            message: resp.data.msg,
            color: "positive"
          });
          this.dlgEditar = false;
        }).catch(error => {
          this.$q.notify({
            message: error,
            color: "negative"
          });
        }).finally(() => {
          let index = this.rows.findIndex(v => v.id == this.id);
          this.rows.splice(index, 1);
          this.loadingDelete = false;
        });
      }).onCancel(() => {// console.log('>>>> Cancel')
      });
    }

  } // methods

});

